webpackJsonp([0xd338c5630019],{3933:function(a,e){a.exports={data:{markdownRemark:{html:'<p><strong>フリーソフト公開/更新情報</strong> </p>\n<p>バージョン管理ツール(要は開発支援ツール)<a href="/reimu-rcs">REIMU - Revision Easy &#x26; Ideal Managing Unit</a>を公開します。<a href="/!/thC/">東方夢終劇</a>のスクリプト開発を潤滑に行うために開発した支援ツールだからこんなネーミングになっただけで、特にこのツール自体は東方とは関係なかったり。 あと<a href="/emeditor-danmakufu">EmEditor用東方弾幕風構文ファイル</a>を更新、弾幕風v0.12iの新関数に対応しました。</p>\n<h2>即売会当落情報</h2>\n<p>超地元な同人即売会<a href="http://www.h4.dion.ne.jp/%7Ewashoi/">わっしょい</a>(3/26(日)・さいたま-南浦和)に当選しました。スペースNo.はA-8で、頒布物は<a href="/!/leila/">Leila Prismriver</a>及び東方グッズ数点(ポストカードかラミネートカード)の予定です。恐らく<em>相当の暇</em>が予想されますので、もしこの機会に時封城や夢終劇の裏話とかしたい！って奇特な方がいましたらぜひどうぞ。 それと<a href="http://www.reitaisai.com/">博麗神社例大祭</a>は残念ながら一次抽選には漏れてしまったようです。まぁ一応二次抽選がまだ残ってるし、きっとなんとかなるか…な\'Ａ｀</p>\n<h2>サイト障害情報(事前告知)</h2>\n<p>サーバ保守のため、<em>2006/3/14(火) 7:00～7:30の間、danmaq.comに一切アクセス出来なくなります</em>。 この時間帯には<a href="/feedback/thpbbs/">東方ヘタレ絵師修行絵板</a>等一切のコンテンツにアクセスできなくなりますので予めご了承ください。</p>',frontmatter:{cover:null,date:"2006-03-08T00:00:59+09:00",strDate:"2006/3/7",title:"色々告知"}}},pathContext:{path:"/ja/blog/2006/03/08-色々告知/",langKey:"ja"}}}});
